definition:
A genus of showy herbaceous or shrubby plants, brought
   from South America; slipperwort. It has a yellow or purple flower,
   often spotted or striped, the shape of which suggests its name.

To ascertain or determine by mathematical processes,
   usually by the ordinary rules of arithmetic; to reckon up; to estimate;
   to compute.

To utter in a loud or distinct voice; -- often with off;
   as, to call, or call off, the items of an account; to call the roll of
   a military company.

A somewhat riotous parade, accompanied with the blowing
   of tin horns, and other discordant noises; also, a burlesque serenade;
   a charivari.

Having, or relating to the power of producing heat;
   -- applied to foods which, being rich in carbon, as the fats, are
   supposed to give rise to heat in the animal body by oxidation.

False accusation of a crime or offense, maliciously made
   or reported, to the injury of another; malicious misrepresentation;
   slander; detraction.

Having the petals and stamens adnate to the calyx;
   -- applied to a subclass of dicotyledonous plants in the system of the
   French botanist Candolle.

An interwoven or latticed wall or inclosure;
   latticework, rails, or crossbars, as around the bar of a court of
   justice, between the chancel and the nave of a church, or in a window.

Free from undue bias; disposed to think and judge according
   to truth and justice, or without partiality or prejudice; fair; just;
   impartial; as, a candid opinion.

A benefice or prebend in a cathedral or collegiate
   church; a right to a place in chapter and to a portion of its revenues;
   the dignity or emoluments of a canon.

To sift; to strain; to examine thoroughly; to scrutinize;
   as, to canvass the votes cast at an election; to canvass a district
   with reference to its probable vote.

Possessing ability, qualification, or susceptibility;
   having capacity; of sufficient size or strength; as, a room capable of
   holding a large number; a castle capable of resisting a long assault.

Having capacity; able to contain much; large; roomy;
   spacious; extended; broad; as, a capacious vessel, room, bay, or
   harbor.

The power of receiving and holding ideas, knowledge,
   etc.; the comprehensiveness of the mind; the receptive faculty;
   capability of undestanding or feeling.

Outward condition or circumstances; occupation;
   profession; character; position; as, to work in the capacity of a mason
   or a carpenter.

To acquire ascendancy over by reason of some art or
   attraction; to fascinate; to charm; as, Cleopatra captivated Antony;
   the orator captivated all hearts.

General course of action or conduct in life, or in a
   particular part or calling in life, or in some special undertaking;
   usually applied to course or conduct which is of a public character;
   as, Washington's career as a soldier.

Taking care; giving good heed; watchful; cautious;
   provident; not indifferent, heedless, or reckless; -- often followed by
   of, for, or the infinitive; as, careful of money; careful to do right.

Without thought or purpose; without due care; without
   attention to rule or system; unstudied; inconsiderate; spontaneous;
   rash; as, a careless throw; a careless expression.

The lading or freight of a ship or other vessel; the goods,
   merchandise, or whatever is conveyed in a vessel or boat; load;
   freight.

Of or pertaining to the body or its appetites; animal;
   fleshly; sensual; given to sensual indulgence; lustful; human or
   worldly as opposed to spiritual.

That which befalls, comes, or happens; an event; an instance;
   a circumstance, or all the circumstances; condition; state of things;
   affair; as, a strange case; a case of injustice; the case of the Indian
   tribes.

An event producing a subversion of the order or system
   of things; a final event, usually of a calamitous or disastrous nature;
   hence, sudden calamity; great misfortune.

China; -- an old name for the Celestial Empire, said have
   been introduced by Marco Polo and to be a corruption of the Tartar name
   for North China (Khitai, the country of the Khitans.)

One line or radius falling perpendicularly on another;
   as, the catheti of a right-angled triangle, that is, the two sides that
   include the right angle.

Adherence or conformity to the system of doctrine held
   by all parts of the orthodox Christian church; the doctrine so held;
   orthodoxy.

A suit or action in court; any legal process by which a
   party endeavors to obtain his claim, or what he regards as his right;
   case; ground of action.

Attentive to examine probable effects and consequences of
   acts with a view to avoid danger or misfortune; prudent; circumspect;
   wary; watchful; as, a cautious general.

A point equally distant from the extremities of a line,
   figure, or body, or from all parts of the circumference of a circle;
   the middle point or place.

A waxy substance extracted by alcohol or ether from cork;
   sometimes applied also to the portion of beeswax which is soluble in
   alcohol.

To assume as a bearing; as, he charges three roses or;
   to add to or represent on; as, he charges his shield with three roses
   or.

To follow as if to catch; to pursue; to compel to move
   on; to drive by following; to cause to fly; -- often with away or off;
   as, to chase the hens away.

Pure in thought and act; innocent; free from lewdness and
   obscenity, or indecency in act or speech; modest; as, a chaste mind;
   chaste eyes.

An application of chemical theory and method to the
   consideration of some particular subject; as, the chemistry of iron;
   the chemistry of indigo.

Principal or most eminent in any quality or action; most
   distinguished; having most influence; taking the lead; most important;
   as, the chief topic of conversation; the chief interest of man.

The outer membrane which invests the fetus in the womb;
   also, the similar membrane investing many ova at certain stages of
   development.

An instrument for measuring minute intervals of time;
   used in determining the velocity of projectiles, the duration of
   short-lived luminous phenomena, etc.

A sedgelike plant (Cyperus esculentus) producing edible
   tubers, native about the Mediterranean, now cultivated in many regions;
   the earth almond.

The aggregate of religious influences in a community;
   ecclesiastical influence, authority, etc.; as, to array the power of
   the church against some moral evil.

Something incidental to the main subject, but of
   less importance; opposed to an essential; -- generally in the plural;
   as, the circumstantials of religion.

To make a sudden, sharp noise, or a succesion of such
   noises, as by striking an object, or by collision of parts; to rattle;
   to click.

Speaking and repeating loud words; full of clamor;
   calling or demanding loudly or urgently; vociferous; noisy; bawling;
   loud; turbulent.

Conducted with secrecy; withdrawn from public notice,
   usually for an evil purpose; kept secret; hidden; private; underhand;
   as, a clandestine marriage.

Of or pertaining to a clan; closely united, like a clan;
   disposed to associate only with one's clan or clique; actuated by the
   traditions, prejudices, habits, etc., of a clan.

Full extent; distance between extreme limits; especially;
   the distance between the nearest surfaces of two bodies, or the space
   between walls; as, a room ten feet square in the clear.

A genus of flowering plants, of many species, mostly
   climbers, having feathery styles, which greatly enlarge in the fruit;
   -- called also virgin's bower.

Having the parts near each other; dense; solid; compact;
   as applied to bodies; viscous; tenacious; not volatile, as applied to
   liquids.

Covering for the human body; dress; vestments;
   vesture; -- a general term for whatever covering is worn, or is made to
   be worn, for decency or comfort.

A dark vein or spot on a lighter material, as in marble;
   hence, a blemish or defect; as, a cloud upon one's reputation; a cloud
   on a title.

The hands, claws, or talons, in the act of grasping firmly;
   -- often figuratively, for power, rapacity, or cruelty; as, to fall
   into the clutches of an adversary.

The quality or state of being coarse; roughness;
   inelegance; vulgarity; grossness; as, coarseness of food, texture,
   manners, or language.

Pertaining to, derived from, or containing, cobalt; --
   said especially of those compounds in which cobalt has higher valence;
   as, cobaltic oxide.

A water-tight inclosure, as of piles packed with clay,
   from which the water is pumped to expose the bottom (of a river, etc.)
   and permit the laying of foundations, building of piers, etc.

Of the same or a similar nature; of the same family;
   proceeding from the same stock or root; allied; kindred; as, a cognate
   language.

To make of a definite fineness, and convert into coins, as
   a mass of metal; to mint; to manufacture; as, to coin silver dollars;
   to coin a medal.

A small metal ring; a small collar fastened on an arbor;
   as, the collet on the balance arbor of a watch; a small socket on a
   stem, for holding a drill.

Pertaining to, or used in, conversation, esp. common
   and familiar conversation; conversational; hence, unstudied; informal;
   as, colloquial intercourse; colloquial phrases; a colloquial style.

A secret agreement and cooperation for a fraudulent or
   deceitful purpose; a playing into each other's hands; deceit; fraud;
   cunning.

A note or observation intended to explain, illustrate, or
   criticise the meaning of a writing, book, etc.; explanation;
   annotation; exposition.

Of or pertaining to commerce; carrying on or occupied
   with commerce or trade; mercantile; as, commercial advantages;
   commercial relations.

To reduce to minute particles, or to a fine powder;
   to pulverize; to triturate; to grind; as, to comminute chalk or bones;
   to comminute food with the teeth.

Intercourse by words, letters, or messages;
   interchange of thoughts or opinions, by conference or other means;
   conference; correspondence.

The comparative degree of adjectives and adverbs;
   also, the form by which the comparative degree is expressed; as,
   stronger, wiser, weaker, more stormy, less windy, are all comparatives.

The act of comparing; an examination of two or more
   objects with the view of discovering the resemblances or differences;
   relative estimate.

The modification, by inflection or otherwise, which the
   adjective and adverb undergo to denote degrees of quality or quantity;
   as, little, less, least, are examples of comparison.

Literally, suffering with another; a sensation of
   sorrow excited by the distress or misfortunes of another; pity;
   commiseration.

To drive or urge with force, or irresistibly; to force;
   to constrain; to oblige; to necessitate, either by physical or moral
   force.

To bring to a state in which there is no deficiency;
   to perfect; to consummate; to accomplish; to fulfill; to finish; as, to
   complete a task, or a poem; to complete a course of education.

To fold or twist together; to combine intricately;
   to make complex; to combine or associate so as to make intricate or
   difficult.

The act or process of complicating; the state of
   being complicated; intricate or confused relation of parts;
   entanglement; complexity.

An expression, by word or act, of approbation, regard,
   confidence, civility, or admiration; a flattering speech or attention;
   a ceremonious greeting; as, to send one's compliments to a friend.

The adjustment of a debt, or avoidance of an
   obligation, by some form of compensation agreed on between the parties;
   also, the sum or amount of compensation agreed upon in the adjustment.

Composed of two or more elements, ingredients, parts;
   produced by the union of several ingredients, parts, or things;
   composite; as, a compound word.

The capacity of the mind to perceive and understand;
   the power, act, or process of grasping with the intellect; perception;
   understanding; as, a comprehension of abstract principles.

To press or squeeze together; to force into a narrower
   compass; to reduce the volume of by pressure; to compact; to condense;
   as, to compress air or water.

The act of compelling, or the state of being compelled;
   the act of driving or urging by force or by physical or moral
   constraint; subjection to force.

The act or process of concentrating; the process of
   becoming concentrated, or the state of being concentrated;
   concentration.

Agreement in a design or plan; union formed by mutual
   communication of opinions and views; accordance in a scheme; harmony;
   simultaneous action.

Belonging to a close or termination; decisive;
   convincing; putting an end to debate or question; leading to, or
   involving, a conclusion or decision.

A mass or nodule of solid matter formed by growing
   together, by congelation, condensation, coagulation, induration, etc.;
   a clot; a lump; a calculus.

To adjudge or pronounce to be unfit for use or service;
   to adjudge or pronounce to be forfeited; as, the ship and her cargo
   were condemned.

Something used to give relish to food, and to gratify
   the taste; a pungment and appetizing substance, as pepper or mustard;
   seasoning.

A league or compact between two or more persons,
   bodies of men, or states, for mutual support or common action;
   alliance.

The act of confiding, trusting, or putting faith in;
   trust; reliance; belief; -- formerly followed by of, now commonly by
   in.

That which confirms; that which gives new strength or
   assurance; as to a statement or belief; additional evidence; proof;
   convincing testimony.

Any running together of separate streams or currents;
   the act of meeting and crowding in a place; hence, a crowd; a
   concourse; an assemblage.

Corresponding in form, character, opinions, etc.;
   similar; like; consistent; proper or suitable; -- usually followed by
   to.

That which is heaped together in a mass or conpacted
   from various sources; a mass formed of fragments; collection;
   accumulation.

To address with expressions of sympathetic
   pleasure on account of some happy event affecting the person addressed;
   to wish joy to.

The state or quality of being congruous; the relation or
   agreement between things; fitness; harmony; correspondence;
   consistency.

Having the form of, or resembling, a geometrical cone;
   round and tapering to a point, or gradually lessening in circumference;
   as, a conic or conical figure; a conical vessel.

A combining form, meaning somewhat resembling a cone; as,
   conico-cylindrical, resembling a cone and a cylinder;
   conico-hemispherical; conico-subulate.

A crisis produced by a combination of circumstances;
   complication or combination of events or circumstances; plight
   resulting from various conditions.

The act of calling or summoning by a sacred name, or
   in solemn manner; the act of binding by an oath; an earnest entreaty;
   adjuration.

The act or process of invoking supernatural aid by the
   use of a magical form of words; the practice of magic arts;
   incantation; enchantment.

To join, unite, or cohere; to have a close relation;
   as, one line of railroad connects with another; one argument connect
   with another.

The act or process of conquering, or acquiring by force;
   the act of overcoming or subduing opposition by force, whether physical
   or moral; subjection; subjugation; victory.

Assuming or exhibiting an air of consequence;
   pretending to importance; pompous; self-important; as, a consequential
   man. See Consequence, n., 4.

Given to consideration or to sober reflection;
   regardful of consequences or circumstances; circumspect; careful; esp.
   careful of the rights, claims, and feelings of other.

The condition of standing or adhering together, or
   being fixed in union, as the parts of a body; existence; firmness;
   coherence; solidity.

Agreement or harmony of all parts of a complex thing
   among themselves, or of the same thing with itself at different times;
   the harmony of conduct with profession; congruity; correspondence; as,
   the consistency of laws, regulations, or judicial decisions;
   consistency of opinions; consistency of conduct or of character.

Having agreement with itself or with something else;
   having harmony among its parts; possesing unity; accordant; harmonious;
   congruous; compatible; uniform; not contradictory.

The act of consoling; the state of being consoled;
   allevation of misery or distress of mind; refreshment of spirit;
   comfort; that which consoles or comforts the spirit.

A combination of men for an evil purpose; an agreement,
   between two or more persons, to commit a crime in concert, as treason;
   a plot.

To make an agreement, esp. a secret agreement, to do
   some act, as to commit treason or a crime, or to do some unlawful deed;
   to plot together.

The state or quality of being constant or steadfast;
   freedom from change; stability; fixedness; immutability; as, the
   constancy of God in his nature and attributes.

Fixedness or firmness of mind; persevering resolution;
   especially, firmness of mind under sufferings, steadiness in
   attachments, or perseverance in enterprise; stability; fidelity.

Amazement or horror that confounds the faculties,
   and incapacitates for reflection; terror, combined with amazement;
   dismay.

The act or process of constituting; the action of
   enacting, establishing, or appointing; enactment; establishment;
   formation.

Belonging to, or inherent in, the constitution, or
   in the structure of body or mind; as, a constitutional infirmity;
   constitutional ardor or dullness.

The act of constraining, or the state of being
   constrained; that which compels to, or restrains from, action;
   compulsion; restraint; necessity.

The process or art of constructing; the act of
   building; erection; the act of devising and forming; fabrication;
   composition.

The method of construing, interpreting, or explaining
   a declaration or fact; an attributed sense or meaning; understanding;
   explanation; interpretation; sense.

The actual, substantial presence of the body of
   Christ with the bread and wine of the sacrament of the Lord's Supper;
   impanation; -- opposed to transubstantiation.

The act of the mind in considering with attention;
   continued attention of the mind to a particular subject; meditation;
   musing; study.

The act of contemning or despising; the feeling with
   which one regards that which is esteemed mean, vile, or worthless;
   disdain; scorn.

Contained within limits; hence, having the desires limited
   by that which one has; not disposed to repine or grumble; satisfied;
   contented; at rest.

The arrangement and union of the constituent parts of a
   thing; a weaving together of parts; structural character of a thing;
   system; constitution; texture.

A holding on, or remaining in a particular state;
   permanence, as of condition, habits, abode, etc.; perseverance;
   constancy; duration; stay.

That act or state of continuing; the state of being
   continued; uninterrupted extension or succession; prolongation;
   propagation.

Double bass; -- applied to any instrument of the same
   deep range as the stringed double bass; as, the contrabass ophicleide;
   the contrabass tuba or bombardon.

To meet in the way of opposition; to come into
   conflict with; to oppose; to contradict; to obstruct the operation of;
   to defeat.

Rudeness compounded of haughtiness and contempt;
   scornful insolence; despiteful treatment; disdain; contemptuousness in
   act or speech; disgrace.

The act of turning or changing from one state or
   condition to another, or the state of being changed; transmutation;
   change.

Rising or swelling into a spherical or rounded form;
   regularly protuberant or bulging; -- said of a spherical surface or
   curved line when viewed from without, in opposition to concave.

Of or relating to a feast or entertainment, or to eating
   and drinking, with accompanying festivity; festive; social; gay;
   jovial.

An irregular, tortuous folding of an organ or part;
   as, the convolutions of the intestines; the cerebral convolutions. See
   Brain.

Not ardent, warm, fond, or passionate; not hasty;
   deliberate; exercising self-control; self-possessed; dispassionate;
   indifferent; as, a cool lover; a cool debater.

A moderate state of cold; coolness; -- said of the
   temperature of the air between hot and cold; as, the cool of the day;
   the cool of the morning or evening.

To give a common action, movement, or condition to;
   to regulate and combine so as to produce harmonious action; to adjust;
   to harmonize; as, to coordinate muscular movements.

To enter into or maintain a hostile contest; to struggle;
   to combat; especially, to strive or contend on equal terms or with
   success; to match; to equal; -- usually followed by with.

To trifle in love; to stimulate affection or interest;
   to play the coquette; to deal playfully instead of seriously; to play
   (with); as, we have coquetted with political crime.

A mineral consisting principally of sulphate of iron;
   white copperas; -- so called because found in the province of Coquimbo,
   Chili.

Fig.: Any moral influence by which persons are caught, held,
   or drawn, as if by a cord; an enticement; as, the cords of the wicked;
   the cords of sin; the cords of vanity.

The act of reproving or punishing, or that which is
   intended to rectify or to cure faults; punishment; discipline;
   chastisement.

The state or quality of being correct; as, the
   correctness of opinions or of manners; correctness of taste;
   correctness in writing or speaking; the correctness of a text or copy.

The act of corrupting or of impairing integrity,
   virtue, or moral principle; the state of being corrupted or debased;
   loss of purity or integrity; depravity; wickedness; impurity; bribery.

a stream of lava. Also, in the Western United States, the
   bed of a stream, even if dry, when deep and having inclined sides;
   distinguished from a caon, which has precipitous sides.

To tell or name one by one, or by groups, for the purpose
   of ascertaining the whole number of units in a collection; to number;
   to enumerate; to compute; to reckon.

Contrary; opposite; contrasted; opposed; adverse;
   antagonistic; as, a counter current; a counter revolution; a counter
   poison; a counter agent; counter fugue.

Adorned with flowers (usually fleurs-de-lis) so
   divided that the tops appear on one side and the bottoms on the others;
   -- said of any ordinary.

To act against with equal force, power, or effect;
   to thwart or overcome by such action; to furnish an equivalent to or
   for; to counterbalance; to compensate.

Pertaining to the regions remote from a city; rural;
   rustic; as, a country life; a country town; the country party, as
   opposed to city.

That quality of mind which enables one to encounter danger
   and difficulties with firmness, or without fear, or fainting of heart;
   valor; boldness; resolution.

Progress from point to point without change of direction;
   any part of a progress from one place to another, which is in a
   straight line, or on one direction; as, a ship in a long voyage makes
   many courses; a course measured by a surveyor between two stations;
   also, a progress without interruption or rest; a heat; as, one course
   of a race.

Attention directed to a person in power; conduct or address
   designed to gain favor; courtliness of manners; civility; compliment;
   flattery.

Of courtlike manners; pertaining to, or expressive of,
   courtesy; characterized by courtesy; civil; obliging; well bred;
   polite; affable; complaisant.

Shrinking from approach or familiarity; reserved; bashful;
   shy; modest; -- usually applied to women, sometimes with an implication
   of coquetry.

A contraction of two vowels (as the final and initial
   vowels of united words) into one long vowel, or into a diphthong;
   synaeresis; as, cogo for coago.

To move along the ground, or on any other surface, on the
   belly, as a worm or reptile; to move as a child on the hands and knees;
   to crawl.

To burn; to reduce to ashes by the action of fire,
   either directly or in an oven or retort; to incremate or incinerate;
   as, to cremate a corpse, instead of burying it.

That which is crisp or brittle; the state of being crisp or
   brittle; as, burned to a crisp; specifically, the rind of roasted pork;
   crackling.

The condition or quality of being crooked; hence,
   deformity of body or of mind; deviation from moral rectitude;
   perverseness.

A vacuum tube in which the exhaustion is carried to a
   very high degree, with the production of a distinct class of effects;
   -- so called from W. Crookes who introduced it.

That which is cropped, cut, or gathered from a single felld,
   or of a single kind of grain or fruit, or in a single season;
   especially, the product of what is planted in the earth; fruit;
   harvest.

Having or wearing a crown; surmounted, invested,
   or adorned, with a crown, wreath, garland, etc.; honored; rewarded;
   completed; consummated; perfected.

A crude, undigested, or unprepared state; rawness;
   unripeness; immatureness; unfitness for a destined use or purpose; as,
   the crudeness of iron ore; crudeness of theories or plans.

Disposed to give pain to others; willing or pleased to hurt,
   torment, or afflict; destitute of sympathetic kindness and pity;
   savage; inhuman; hard-hearted; merciless.

Of or pertaining to the thigh or leg, or to any of the
   parts called crura; as, the crural arteries; crural arch; crural canal;
   crural ring.

The state of being cultivated; result of cultivation;
   physical improvement; enlightenment and discipline acquired by mental
   and moral training; civilization; refinement in manners and taste.

To rest upon as a troublesome or useless weight or load;
   to be burdensome or oppressive to; to hinder or embarrass in attaining
   an object, to obstruct or occupy uselessly; to embarrass; to trouble.

A roof having a rounded form, hemispherical or nearly so;
   also, a ceiling having the same form. When on a large scale it is
   usually called dome.

Exciting attention or inquiry; awakening surprise;
   inviting and rewarding inquisitiveness; not simple or plain; strange;
   rare.

Passing from person to person, or from hand to hand;
   circulating through the community; generally received; common; as, a
   current coin; a current report; current history.

The pointless sword carried before English monarchs at
   their coronation, and emblematically considered as the sword of mercy;
   -- also called the sword of Edward the Confessor.

Habitual buying of goods; practice of frequenting, as a
   shop, manufactory, etc., for making purchases or giving orders;
   business support.

Pertaining to the Cyclops; characteristic of the
   Cyclops; huge; gigantic; vast and rough; massive; as, Cyclopean labors;
   Cyclopean architecture.

Belonging to the sect of philosophers called cynics;
   having the qualities of a cynic; pertaining to, or resembling, the
   doctrines of the cynics.

The doctrine of the Cynics; the quality of being cynical;
   the mental state, opinions, or conduct, of a cynic; morose and
   contemptuous views and opinions.
